('2374','18','7892','Pablo Suarez García',Null,'12 projektierte Baugrundstücke für moderne Villen','33407','In ruhiger Wohnlage in Canpastilla, nur wenige Gehminuten vom Strand entfernt, liegen diese 12 Baugrundstücke mit je 300m³. Jede der 12 geplanten modernen Villen hat ca 230m² Wohnfläche auf 2 Etagen verteilt. Im EG befinden sich ein Licht durchflutetes Wohn-Esszimmer mit moderner offener Küche und Gäste WC. Im 1.OG hat es 3 Schlafzimmer und 2 Badezimmer. Relaxen kann man am eigenen Pool','33408','650000','106','2015-09-09 14:30:20','106','2015-09-09 14:32:31',Null,'2466','105','1157',1,'1','0',Null,Null,Null,'33409',Null,'0','0','0',Null,'2015-09-09 14:39:51',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33410',Null,'33411',Null,'33412',Null,'33413','Pablo Suarez García  655 272 024','33414','0',0,'0');
